INSERT INTO article VALUES(1343990891547, '标题0', 'permalink0', '<img title="失恋33天" src="http://apollo.s.dpool.sina.com.cn/nd/dataent/moviepic/pics/125/moviepic_1a9ed2bc6faaaf7d12ba0ec035e61a71.jpg" alt="失恋33天" /> 失恋33天   鲍鲸鲸   6月26日 星期日 大风天 　　亲眼看到我男朋友挽着他新欢的手，在新光天地里试喷香水的那一刻，世界“蹭”的一声，变得格外面目可憎。这种眼见为实的背叛，是第一次，但不会是最后一次，因为这种前不着村后不着店，让呆立在他们两人不远处的我，顿时觉得生死两茫茫起来。<!--more--> 　　我一路跑回家，瘫坐在沙发上时，已累到呼吸濒临衰竭，那一刻的我无论从哪个层面看，都是在苟延残喘。我眨眨眼睛，眼角很干涩，我没有痛哭失声，但在我脑海中，房间里，各个角落，漫山遍野，似乎都在大剂量的播放着苦情歌。我的心一阵阵的抽搐，手指也在微微颤抖。我筋疲力尽，想要侧身靠一靠，却发现，沙发在我眼中已大到无边，全世界，都没有一个支点。 　　我曾以为这是最后一次恋爱。 　　可悲的是，每一次奋身投入一段感情中时，我都会这么想。 　　但这一次，我同他始终那么甜蜜那么默契，甚至，甚至在事发前一天，他还在说我爱你。 　　我努力想要回忆起我们曾经的好情意，但是，它们的真实程度，在此刻遭到了毁灭性的质疑。 　　若仅仅是这样，或许还不至于那么猛烈的击垮我。我仍可以像从前的某次恋爱一样，分手在即时，心中骂着诅咒的话，但仍会笑着祝对方日后一切顺利。 　　而这一次，我指着那一对甜蜜的人儿破口大骂是因为，他身边那娇羞的新欢，竟是从初中起便和我混在一起四处嬉戏的首席资深闺蜜。 　　是这个事实击垮了我。 　　这事实令我觉得，有问题的那个人是我。 　　曾经有那么多迹象逼我恍然大悟，但我却统统选择视而不见。而一个人究竟要糟糕到什么田地，才会发生这样的事：小三是自己的闺蜜？ 　　恍惚间，我都能听到老天爷自上空指着我，发出不屑的笑声。 　　从小到大，闺蜜见证了我每一次和男友的大动干戈，我的男友们也都或多或少的遇到过我和闺蜜相互间的肆意撒泼。和闺蜜生气时，我便去找男友发泄情绪，和男友吵架时，我便去找闺蜜围炉夜话。 　　但此刻，我却同时被两边摒弃，整个人就像是从传送带上掉下来的零件，自己倍感孤单，但这不是重点，重点是，对世界而言，我不构成任何存在感。 　　我就这样坐在沙发上，一昧的发着呆，快要石化的时候，电话突然响了，随着电话铃声，我全身上下的毛孔顿时全部大幅度张开，作倾听状。 　　会是两个人里的谁打来的？还是联袂一起打来的?是要跟我道歉，还是要说服我变化是幻觉刚刚那一幕只是我眼花了？ 　　我紧张的发抖，电话铃声变得不耐烦起来，我仿佛能听见，电话那头的人正说着：嘿，过时不候，机会有限。 　　我一把抓起电话，声音飘忽的说了一句，喂？然后便紧紧的闭上嘴，准备随机应变。 　　电话那头，有个男人大吼着说，黄小仙儿！打你丫电话一直关机！你穷的要死了吗？我没给你发工资吗?给我赶快回来加班！！ 　　我抓着电话愣了半天，才反应过来，正在冲我大吼的男人，是大老王—我老板。 　　不知道从哪儿横生出的勇气，让我在愣了半天后，冲着大老王说出了那句本想献给那对野鸳鸯的话。 　　“你丫给我滚！” 　　这次换大老王呆住了，几秒钟后，他默默的挂了电话。 　　我蹲在地板上，听着房间里回荡着的大吼过后的袅袅余音。做的好，黄小仙儿，我对自己说，一天里，先是分了手，然后失去了一个朋友，接着又因为对老板大吼，从而把工作丢了，接下来，你只要从地板上站起来，关好门窗，走向厨房，轻轻打开煤气，然后，静静的深呼吸，过不了多久，你的人生就可以涅槃了。 　　房间里一片寂静，只有指针向前移动的声音。随着一声清脆的契合声，我抬头看向时钟，时针分针秒针，都指向了零点。 　　我就这样迎来了，失恋的第一天。 ---------  *1* 第一天 6月27日 星期一 风和日丽 　　我断断续续的，做了很多个没有具体情境的梦，猛然醒来时，觉得这一觉有一辈子那么长。睡意彻底消失前一秒，我还想要陷在梦中永远不要醒来。因为我知道，但凡睁开眼，我就会看到几个硕大的当日主题词：分手，背叛，炒鱿鱼。 　　我想要侧过头看看时间，却突然发现自己的脖子动不了了，恍惚间，觉得天花板也比平时要高，原来，一整晚睡在了地板上，落枕了。 　　我挺着脖子，僵着一张脸，战战兢兢的出现在公司里，前台小姐神情诡异，且埋头作劳碌状，这说明大老王今天一反常态的准时出现在公司里了。 　　果然，我刚坐到座位上，坐我隔壁的死同性恋王小贱就转过头，面无表情的通知我，大老王在召唤。 　　我做好了被扫地出门的心理准备，同时另一个自我也在积极的为我做着心里辅导和安慰，即使不开除你，你都是应该自己辞职走人的，还会有什么情况，能比的上你惨遭失恋还要在婚庆策划公司工作更悲凉？ 　　我目不能斜视的出', '标签1,标签2,标签3,标签4', '2012-08-03 18:48:11', 4, 0, 0, 1, 0);
