SET SQL_MODE="NO_AUTO_VALUE_ON_ZERO";

DROP TABLE IF EXISTS article;
CREATE TABLE article (
  article_id bigint(20) NOT NULL,
  title varchar(1024) NOT NULL,
  permalink varchar(255) NOT NULL,
  content text NOT NULL,
  tag varchar(255) NOT NULL,
  create_time datetime NOT NULL,
  stat tinyint(1) NOT NULL,
  hits int(10) NOT NULL,
  comment_count int(10) NOT NULL,
  comment_status tinyint(1) NOT NULL,
  is_page tinyint(1) NOT NULL,
  PRIMARY KEY (article_id),
  KEY permalink (permalink(191)),
  KEY is_page (is_page),
  KEY stat (stat)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `comment`;
CREATE TABLE `comment` (
  comment_id bigint(20) NOT NULL,
  article_id bigint(20) NOT NULL,
  author varchar(255) NOT NULL,
  email varchar(255) NOT NULL,
  ip varchar(50) NOT NULL,
  post_time datetime NOT NULL,
  agent varchar(255) NOT NULL,
  content text NOT NULL,
  stat tinyint(1) NOT NULL,
  parrent_id bigint(20) NOT NULL,
  PRIMARY KEY (comment_id),
  KEY article_id (article_id),
  KEY stat (stat)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS config;
CREATE TABLE config (
  config_key varchar(64) NOT NULL,
  config_value varchar(2048) NOT NULL,
  PRIMARY KEY (config_key)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS item;
CREATE TABLE item (
  item_id bigint(20) NOT NULL,
  item_name varchar(255) NOT NULL,
  permalink varchar(255) NOT NULL,
  description varchar(2048) NOT NULL,
  count int(10) NOT NULL,
  item_order tinyint(3) NOT NULL,
  item_type tinyint(3) NOT NULL,
  parrent_id bigint(20) NOT NULL,
  stat tinyint(1) NOT NULL,
  PRIMARY KEY (item_id),
  KEY item_type (item_type),
  KEY stat (stat)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS relationship;
CREATE TABLE relationship (
  item_id bigint(20) NOT NULL,
  article_id bigint(20) NOT NULL,
  PRIMARY KEY (item_id,article_id)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  user_id bigint(20) NOT NULL,
  username varchar(255) NOT NULL,
  passwd varchar(127) NOT NULL,
  nickname varchar(255) NOT NULL,
  permalink varchar(255) NOT NULL,
  email varchar(255) NOT NULL,
  regtime datetime NOT NULL,
  usergroup tinyint(1) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

